import React from "react";
import web from '../images/web.png';
import Common from "./Common";

const Home=()=>{
    return(
        <>
        <Common name="Grw your business with" 
        imgsrc={web}
         visit="/services" 
         btname="Get Started"
         />
        </>
    )
}
export default Home;
